import React from "react";
import "../css/home.css";
import { Grid } from "@material-ui/core";

const Home = () => {
    return (
        <>
            <Grid container className="computer">
                <Grid
                    item
                    xs={12}
                    container
                    direction="row"
                    justify="center"
                    spacing={2}
                >
                    <Grid item>
                        <h1 className="title">Maxence</h1>
                    </Grid>
                    <Grid item>
                        <h1 className="title">Liboz</h1>
                    </Grid>
                </Grid>
            </Grid>
        </>
    );
};

export default Home;
